import React from 'react'

import Tour from './Tour'

const Tours = ({tours}) => {
    return(
        <section>
            <div>
                <h1>Tours</h1>
            </div>
            <div>
            {tours.map((tour) => {
                    return(
                        <Tour />
                    )
            })}
            </div>
        </section>
    )
}

export default Tours
